Answer: When you're using arrow functions with async/await the call to `delay` needs to be in the body of the arrow function. Otherwise, the call will be awaited immediately, so nothing gets delayed.

\begin{code}
function delay(ms) {
    return new Promise(resolve =>
        setTimeout(resolve, ms));
}

async function sayHello(name) {
    await delay(1000);
    console.log('Hello, ' + name);
}

sayHello('Alice');
sayHello('Bob');
\end{code}

This is a fairly common issue. You can read about it in [these answers](https://stackoverflow.com/questions/36114576/uncaught-referenceerror-async-function-must-have-an-async-function-body-to) to a previous question I answered.

